const BannerTitleContent = ({numItem, numTranslate}) => { //numTranslate = translate1/
    return(
        <div className={`bannerTitleContent ${numItem} ${numTranslate}`}>
            <span></span>
            <p>Son</p>
        </div>
    );
}; 



const BannerTitle = ({numTranslate}) => {

    return (
        <div className={`bannerTitle`}>
            <BannerTitleContent numItem="item1" numTranslate={numTranslate}/>
            <BannerTitleContent numItem="item2" numTranslate={numTranslate}/>
            <BannerTitleContent numItem="item3" numTranslate={numTranslate}/>
            <BannerTitleContent numItem="item4" numTranslate={numTranslate}/>
            <BannerTitleContent numItem="item5" numTranslate={numTranslate}/>
            <BannerTitleContent numItem="item6" numTranslate={numTranslate}/>
            <BannerTitleContent numItem="item7" numTranslate={numTranslate}/>
            <BannerTitleContent numItem="item8" numTranslate={numTranslate}/>
            <BannerTitleContent numItem="item9" numTranslate={numTranslate}/>
        </div>
    );
};


export default BannerTitle;
